import { BUY_POKEMON, RETURN_POKEMON } from "./types";

const buyPokemon = (cantidad) => ({
    type: BUY_POKEMON,
    cantidad,
});

const returnPokemon = (cantidad) => ({
    type: RETURN_POKEMON,
    cantidad,
});

export { buyPokemon, returnPokemon };
